	if (!(liveRegsMask & (1U << DPFPReg2))) {
		return DPFPReg2;
	}
	if (!(liveRegsMask & (1U << DPFPReg3))) {
		return DPFPReg3;
	}
	if (!(liveRegsMask & (1U << DPFPReg4))) {
		return DPFPReg4;
	}
	if (!(liveRegsMask & (1U << DPFPReg5))) {
		return DPFPReg5;
	}
	if (!(liveRegsMask & (1U << DPFPReg6))) {
		return DPFPReg6;
	}
	if (!(liveRegsMask & (1U << DPFPReg7))) {
		return DPFPReg7;
	}
	return NoReg;
