	cacheValue = selector;

	/* begin gen:uniqueLiteral:operand: */
	opcode = MoveCwR;
	/* begin uniqueLiteral:forInstruction: */
	anInstruction = genoperandoperand(opcode, cacheValue, ClassReg);
